import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Typography,
} from "@material-ui/core";
import "./Flight.css";

import { useState } from "react";
import { Modal, Button } from "antd";
import ModalFlight from "./ModalFlight";

const dataSource = [
  {
    key: '1',
    brand: {
      logo: <img src="https://static.wixstatic.com/media/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg/v1/fill/w_1000,h_626,al_c,q_90,usm_0.66_1.00_0.01/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg" alt="logo-brand" width='100px'/>,
      brandName: 'VietNam Airline'
    },
    flight: 'VNU127',
    price: 1000000,
    time: {
      tgiandi: '10:20'
    },
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },
];

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address',
  },
];

function Flight() {
 
  return (
    <div className="wrapper">
      <h5>Kết quả tìm kiếm</h5>
    </div>
  );
}

export default Flight;
